import React from "react";
import "../App.css";
import "../styles/SidebarMenu.css";
import { Link } from "react-router-dom";

const SidebarMenu = (userState) => {
  const menuList = [
    "공지사항",
    "즐겨찾기",
    "마이페이지",
    "문의하기",
    "마이 스탬프",
  ];
  return (
    <div>
      <h1>dd</h1>
      {menuList.map((item) => {
        {
          <h1>{item}</h1>;
        }
      })}
    </div>
  );
};

export default SidebarMenu;
